import React from 'react'
import styled from 'styled-components'
import QRcode from 'react-qr-code';
import { NavLink } from 'react-router-dom'
import house from '../Images/'

const Contact: React.FC = () => {

    return (
        <StyledContainer>
            <StyledSectionsHolder>
        <StyledSections to='/' exact activeClassName="firstSection" >Home</StyledSections>
        </StyledSectionsHolder>
            <StyledInnerContainer>
                <StyledInnerGrouping>
            <QRcode size={87} value={"https://t.me/SamInTaiwan"} />
            <StyledLink target='_self' href="https://t.me/SamInTaiwan">Telegram</StyledLink>
            </StyledInnerGrouping>
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://line.me/R/ti/p/samdepramere"} />
            <StyledLink target='_self' href="https://line.me/R/ti/p/samdepramere">Line</StyledLink>
            </StyledInnerGrouping>
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://wa.me/886975139873"} />
            <StyledLink target='_self' href="https://wa.me/886975139873">WhatsApp</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
            <StyledInnerContainer>
            <StyledInnerGrouping>
            <QRcode size={87} value={"https://twitter.com/CryptoOwl3"} />
            <StyledLink target='_self' href="https://twitter.com/CryptoOwl3">Twitter</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
        </StyledContainer>
    )
}

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledInnerContainer = styled.div`
display: flex;
flex-flow: row;
margin-top: 80px;
margin-left: auto;
margin-right: auto;
justify-content: center;
width: 80%;
height: 15%;
`
const StyledLink = styled.a`
text-decoration: none;
color: unset;
cursor: pointer;
`
const StyledInnerGrouping = styled.div`
width: 33%;
height: 100px;
display: flex;
flex-direction: column;
align-items: center;
`

const StyledVerticalSpacer = styled.div`
width: 100%;
height: 50px;
`
const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
    position: absolute;
    color:unset;
    text-decoration: none;
    top: 0;
    left: 0;
    height: 15%;
    width: 15%;
    display: flex;
`

export default Contact
